11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Всемирно известен как один из величайших волшебников эпохи. Одаренный плодородным гением, доброжелательностью, дружелюбием и проницательностью. Из всех маскировок он предпочитает превращаться в кролика, и лишь некоторые видели за магией его настоящее лицо."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"Легендарный рассказчик и музыкальный композитор племени. Пока он бродил по землям и морям, никто и никогда его не видел. С его глубоким голосом и остроумием было произнесено много хвалебных речей. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Чистая и безупречная. Полная любопытства к внешнему миру, она любит играть на барабанах, когда чувствует энергию."],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Король всех львов и ходит как человек. Когда-то он утратил свою прекрасную родину вместе со своими членами племени, но благодаря его исключительной силе, уму и храбрости настоящий лидер, наконец, вернет ее обратно."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
