12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%><color=#38aec0>Родная земля</color> разблокирована! Посетите ее!"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>Добрый человек, помоги, пожалуйста!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>Я в ловушке этих <color=#38c0a5>Тотемов</color>!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"Перетащите 3 любых <color=#38c0a5>Тотема</color> одного вида, чтобы <color=#f58c26>Объединить</color> их, и проклятье спадет."],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>Ой! Я не вижу здесь тотемов!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>Смотрите! Это <color=#f58c26>Метод создания</color>. Он будет попадаться вам на разных уровнях. Давайте посмотрим, что там написано."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Коснитесь его, чтобы получить полезные подсказки по игре. Попробуйте!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>Если хотите пройти уровень, вам нужно получить <color=#f58c26>Целевой предмет</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%><color=#f58c26>Цель уровня</color> подскажет, что вам нужно получить. Начинайте объединять и побеждайте!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Ух ты,<color=#ef933d>Изображение молодой Эмблы</color>! Их сила тоже пропала! Нам нужно пробудить <color=#f58c26>Эмблу</color>, объединив изображения."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Если на уровне есть эти изображения, вы сможете пройти этот уровень, объединив их."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Эти земли утратили связь с богиней и впали в глубокую спячку."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>Вы не можете перемещать предметы на <color=#38aec0>Спящих землях</color>."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Объедините любые <color=#38c0a5>Духовные цветы</color>, чтобы пробудить землю."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>Если вы победите,<color=#f58c26>Богиня Эмбла</color> пробудит все земли!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Смотрите! Это <color=#38c0a5>Тотем</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"Поскорее объедините <color=#38c0a5>Три тотема</color>, чтобы спасти членов племени из ловушки!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Можно коснуться <color=#38c0a5>Дикой рунной сферы</color>, чтобы пробудить землю."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>Вы также можете объединить их, чтобы получить предметы лучше!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Вы можете объединить предметы на <color=#38aec0>Спящих землях</color> с предметам на обычной земле, чтобы пробудить их автоматически."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Коснитесь <color=#38c0a5>Группы тотемов</color>, чтобы получить <color=#38c0a5>Тотем</color>."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Некоторые <color=#38aec0>Крепко спящие земли</color> нельзя пробудить при помощи <color=#f58c26>Очков исцеления</color>. Это можно сделать лишь при объединении с предметами на обычной земле."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>С этих пор, на каждом уровне будут <color=#f58c26>Задания</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Вы можете изучить <color=#38c0a5>Солнце заданий</color>, чтобы просмотреть задания и награды."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Эта кнопка позволяет включить или выключить <color=#f58c26>Функцию перемещения экрана</color>."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Некоторые предметы нельзя объединить напрямую. Коснитесь <color=#ef933d>Кучи клинообразных камней</color>, чтобы разделить их на <color=#ef933d>Клинообразные камни</color>, а затем объедините их. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Необходимо посмотреть <color=#f58c26>Цели уровня</color>."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Мы можем получить <color=#ef933d>Ростки куста</color> из <color=#38c0a5>Костей дракона</color>."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Это огромная <color=#ef933d>Пробуждающая бомба</color>. Если вы пробудите участок земли рядом с ней, она взорвется и пробудит все смежные земли."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Члены племени могут собирать <color=#38c0a5>Руду</color> с <color=#38c0a5>Жил</color> более высокого уровня."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Это <color=#ef933d>Разрушенная гробница</color>. Если вы проигнорируете или объедините их, они превратятся в ужасных <color=#df66a8>Зомби</color>. Победите их, чтобы получить <color=#38c0a5>Светлячков</color>, которые необходимы для прохождения уровня."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"<color=#ef933d>Заброшенное гнездо</color> постоянно создает зомби, даже пока неактивно. Если коснутся его, оно призовет зомби мгновенно! Уничтожение зомби дает вам <color=#38c0a5>Руду</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Это <color=#38c0a5>Рунический портал друидов</color>, нам повезло! Объедините их, чтобы призвать <color=#38c0a5>Члена племени</color> с Родной земли вам на помощь."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"Останки Священного древа создания. Автоматически создает <color=#38c0a5>Дикие рунные сферы</color>. Чем выше уровень, тем мощнее исцеление."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" Отсюда будут появляться <color=#ef933d>Облака</color>. Коснитесь их, чтобы пошел дождь. <color=#38c0a5>Лужи</color> и <color=#38c0a5>Цветы духа</color> будут появляться на пустых участках под ними."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Странно... где же <color=#ef933d>Изображения молодой Эмблы</color>?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Ах, да, если вы завершите <color=#f58c26>Задания</color>, они появятся!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Это <color=#ef933d>Статуя демона</color>. Отвратительное произведение! Прикажите своим людям уничтожить ее, чтобы получить <color=#ef933d>Изображение молодой Эмблы</color>."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>Открыт новый лагерь! Изучите его на Карте мира!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>Я снова свободен! Большое спасибо! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>Люди из нашего племени заточены в этих <color=#38c0a5>Тотемах</color>."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>Племя нуждается в вашей помощи, чтобы найти других членов племени там, и на родной земле."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Поищите их на следующем уровне!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Вы можете отправить кого-то на сбор предметов отсюда при помощи <color=#f58c26>двойного нажатия</color>."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Вы можете использовать или объединить найденные предметы."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Соберите предметы из <color=#38c0a5>Дикого цветка</color>, чтобы получить <color=#38c0a5>Дикую рунную сферу</color>."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Коснитесь сферы</color>, чтобы пробудить <color=#38aec0>Спящие земли</color>."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>Теперь вы сможете выбирать награды в конце каждого уровня."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Обычно в качестве награды вы получите <color=#38c0a5>золото</color> или другие полезные ресурсы. Иногда можно получить даже тотем!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Ваши награды будут помещены в <color=#f58c26>Пузыри</color> и отправлены домой."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Это наша<color=#f58c26>Родная земля</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Раньше здесь был наш дом, до того, как <color=#f58c26>Великий потоп</color> не уничтожил нашу мирную жизнь и не покрыл непроглядным туманом эти земли."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Объединяйте предметы с предметами на спящих землях, чтобы пробудить их! Попытайтесь объединять предметы, чтобы спасти больше членов племени! Чем выше население, тем больше тумана вы сможете рассеять, и поскорее восстановить свой дом."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Вы можете открыть лишь один <color=#38c0a5>Временной сундук сокровищ</color> за раз. Дождитесь окончания отсчета, чтобы получить содержимое, или используйте рубины, чтобы открыть любой <color=#38c0a5>Временной сундук сокровищ</color> мгновенно."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Награды за уровень уже здесь! Откройте пузыри, чтобы просмотреть их!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Длинные дома</color> - это места для отдыха ваших рабочих. Они снова выйдут из них через некоторое время."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"Вы можете объединить <line-height=130%><color=#38c0a5>Длинные дома</color>, чтобы повысить их уровень. Чем выше уровень, тем быстрее отдыхают члены племени."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Используйте<color=#38c0a5>Рубины</color>, чтобы разбудить их мгновенно."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Вы можете выполнить больше заданий на Родной земле, чтобы получить больше <color=#38c0a5>Забытых наследий</color>. Коснитесь их, чтобы получить особые награды!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Это маленький кусочек <color=#38c0a5>Золота</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Коснитесь их, чтобы получить <color=#38c0a5>Золото</color>, или объедините в более качественные золотые самородки."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Вы можете потратить <color=#38c0a5>Золото</color> в <color=#f58c26>Магазине</color>."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Слишком много золота? Вы можете купить много полезного в магазине!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Все <color=#df66a8>Члены племени</color> слишком устали. Им нужен перерыв, чтобы восстановить энергию."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Время пройти новые уровни и спасти больше людей!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Чем больше у вас членов племени, тем больше ресурсов они смогут собрать перед сном."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Проходите уровни, чтобы спасти больше членов племени."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>И вернуть их домой!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Смотрите! Вы можете перейти в Лагерь, коснувшись его на <color=#f58c26>Карте мира</color>."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>На земле нет места для размещения предметов: все участки заняты!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Выберите предмет и откройте меню информации, чтобы продать или выбросить его. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Это <color=#38c0a5>Далекое наследие</color> - очень редкий предмет! Коснитесь его, чтобы получить <color=#38c0a5>Рубины</color>! Или объедините их, чтобы получить улучшенные предметы!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Это кусочек <color=#38c0a5>Руды</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Коснитесь его, чтобы собрать <color=#38c0a5>Руду</color>, или объедините в более качественные версии!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Вы можете потратить собранную <color=#38c0a5>Руду</color> в <color=#f58c26>Магазине</color>."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Если склад <color=#38c0a5>Руды</color> переполнится, вы также сможете потратить ее в магазине."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Эта <color=#38c0a5>Преграда</color> не дает мне покоя! Но ее нельзя переместить. Вы можете приказать <color=#df66a8>Членам племени</color> напасть на нее и разбить на мелкие кусочки."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>Барбеты</color> заражают окружающие участки, даже находясь на спящих землях. <color=#f58c26>Шкала прогресса</color> показывает время до следующего выстрела. Вы можете напасть только на активный барбет."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Это <color=#f58c26>Алтарь героя</color>. Герои будут переключаться между <color=#f58c26>Режимом сна</color> и <color=#f58c26>Режимом патрулирования</color>."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Пока рядом есть героя, вы получите дополнительные награды за <color=#f58c26>объединение 4 предметов</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Используйте<color=#38c0a5>Рубины</color>, чтобы мгновенно вывести из их Режима сна."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Коснитесь этого места, чтобы узнать подробности о герое"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Герои - сильные племенные юниты, обладающие уникальными способностями."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Вы можете просмотреть описание способностей героя в <color=#f58c26>Окне способностей героя</color>."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Вы можете повышать уровни героев, выполняя <color=#f58c26>Задания</color>."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Выполните все задания, чтобы повысить уровень вашего героя!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>Отличная работа! Еще больше членов племени вырвались из плена чародея!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Чем больше людей в вашем племени, тем больше <color=#f58c26>Тумана</color> вы сможете рассеять!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>Для рассеивания тумана в каждой области необходим определенных уровень Силы племени."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Теперь мы можем рассеять туман в этой области!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Вы пока не можете рассеять этот туман."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Ваша <color=#f58c26>Сила племени</color>недостаточно высока. Вы можете купить больше тотемов в магазине."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Используйте золото, чтобы купить тотемы!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>Цена тотемов будет увеличиваться при каждой покупке. Соберите больше золота!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>На этом уровне есть <color=#f58c26>ограничение по времени</color>. Вы должны пройти его за отведенное время, иначе проиграете."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Здесь показано, сколько времени у вас осталось."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>По мере убывания оставшегося времени, цвет чисел измениться с <color=#46bb83>Зеленого</color> на <color=#eca852>Желтый</color>, а затем на <color=#e04030>Красный</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Посетите магазин, чтобы пройти уровень быстрее."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Вы можете использовать <color=#38c0a5>Рубины</color>, чтобы купить необходимые предметы в магазине."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>За прохождение этого уровня вы получите <color=#38c0a5>Члена племени</color>. Вы можете использовать <color=#38c0a5>Рубины</color>, чтобы удвоить награды."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Добро пожаловать на очередное Испытание богов! Вы получите награду за прохождение испытания."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Вы можете пройти испытание <color=#f58c26>три раза</color>, но с каждым разом у вас будет меньше времени."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Вам нужно дождаться завершения обучения героя, чтобы повысить его уровень или использовать <color=#38c0a5>Рубины</color>, чтобы ускорить процесс."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Смотрите, это <color=#46bb83>Туманная пропасть</color>, создающая большую затуманенную область."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Перетащите соответствующий предмет в пропасть, чтобы рассеять туман."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Если пропасть находится в спящих землях, вам будет нужно их пробудить."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Событие началось! Оно будет доступно лишь в течение ограниченного времени!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в Событии. Они будут отправлены на Родную землю!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Факелы нужны для продвижения по уровням! Запас факелов пополняется со временем."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>У вас полно факелов! Используйте их для прохождения уровней!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>Теперь вы можете просматривать <color=#38c0a5>Награды лагеря</color>!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Вы сможете получить свои награды, когда они будут готовы!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>Чем больше звезд за прохождение уровней вы наберете, тем больше наград получите!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Смотрите! Он находится на карте! Разблокируйте и изучите его!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Наш разведчик нашел отличное место для лагеря. Посмотрите сами!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Здесь мы можем встретить очень интересных людей!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Добро пожаловать на событие <color=#46bb83>Зимний отпуск</color>! Впереди вас ждет чудесный мир приключений!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%>Добро пожаловать на событие <color=#46bb83>Сказочный город</color>! Впереди вас ждет чудесный мир приключений!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12804=>["Value"=>12804,"TextKey"=>"新手引导说明2340","TextValue"=>"<line-height=130%>Добро пожаловать на событие <color=#46bb83>На море</color>! Впереди вас ждет чудесный мир приключений!"],
12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12806=>["Value"=>12806,"TextKey"=>"新手引导说明2342","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>Это <color=#46bb83>Предмет события</color>, уникальный для этого события. Коснитесь его, чтобы получить лакомые <color=#46bb83>Очки события</color>!"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>На этой странице показаны все награды, которые можно получить за очки события. Когда вы наберете необходимое количество очков, соответствующая <color=#46bb83>Награда за очки события</color> будет отправлена на вашу <color=#f58c26>Родную землю</color>."],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"Чем больше очков вы соберете, тем больше наград получите! Удачи!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"Доступны <line-height=130%><color=#f58c26>Ежедневные задания. Изучите их!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>Каждый день вам будут доступны несколько <color=#f58c26>Ежедневных заданий</color>. Вы получите награду за выполнение каждого из них."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>Если вы выполните все <color=#f58c26>Ежедневные задания</color>, вы получите <color=#f58c26>Дополнительный приз</color>! "],
12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>Привет, я Мяу-мяу. Добро пожаловать в Королевство <color=#46bb83>Мяу-мяу</color>! Мои владения ждут тебя!"],
12814=>["Value"=>12814,"TextKey"=>"新手引导说明2421","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12815=>["Value"=>12815,"TextKey"=>"新手引导说明2422","TextValue"=>"<line-height=130%>Здесь показаны некоторые уникальные предметы, новые существа (я!) и новые особенности игрового процесса!"],
12816=>["Value"=>12816,"TextKey"=>"新手引导说明2430","TextValue"=>"Где мы? Не могу поверить, что мы в Древнем Египте и нам предстоит разгадать <color=#46bb83>Секрет фараона</color>!"],
12817=>["Value"=>12817,"TextKey"=>"新手引导说明2431","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12818=>["Value"=>12818,"TextKey"=>"新手引导说明2432","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12819=>["Value"=>12819,"TextKey"=>"新手引导说明2460","TextValue"=>"Приветствую, напарник! Добро пожаловать на <color=#46bb83>Дикий Запад</color>!"],
12820=>["Value"=>12820,"TextKey"=>"新手引导说明2461","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12821=>["Value"=>12821,"TextKey"=>"新手引导说明2462","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12822=>["Value"=>12822,"TextKey"=>"新手引导说明2470","TextValue"=>"Погода отличная. Отправимся на <color=#46bb83>Идеальный пикник</color>!"],
12823=>["Value"=>12823,"TextKey"=>"新手引导说明2471","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12824=>["Value"=>12824,"TextKey"=>"新手引导说明2472","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12825=>["Value"=>12825,"TextKey"=>"新手引导说明2500","TextValue"=>"<line-height=130%>Это <color=#46bb83>Предмет события</color>, уникальный для этого события. Коснитесь его, чтобы получить лакомые <color=#46bb83>Очки события</color>!"],
12826=>["Value"=>12826,"TextKey"=>"新手引导说明2502","TextValue"=>"<line-height=130%>На этой странице показаны все награды, которые можно получить за очки события. Когда вы наберете необходимое количество очков, соответствующая <color=#46bb83>Награда за очки события</color> будет отправлена на вашу <color=#f58c26>Родную землю</color>."],
12827=>["Value"=>12827,"TextKey"=>"新手引导说明2503","TextValue"=>"Чем больше очков вы соберете, тем больше наград получите! Удачи!"],
12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"Воплотите вашу детскую мечту в <color=#46bb83>Игрушечном рае</color>!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12830=>["Value"=>12830,"TextKey"=>"新手引导说明2512","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12831=>["Value"=>12831,"TextKey"=>"新手引导说明2520","TextValue"=>"<line-height=130%>Это <color=#46bb83>Предмет события</color>, уникальный для этого события. Коснитесь его, чтобы получить лакомые <color=#46bb83>Очки события</color>!"],
12832=>["Value"=>12832,"TextKey"=>"新手引导说明2522","TextValue"=>"<line-height=130%>На этой странице показаны все награды, которые можно получить за очки события. Когда вы наберете необходимое количество очков, соответствующая <color=#46bb83>Награда за очки события</color> будет отправлена на вашу <color=#f58c26>Родную землю</color>."],
12833=>["Value"=>12833,"TextKey"=>"新手引导说明2523","TextValue"=>"Чем больше очков вы соберете, тем больше наград получите! Удачи!"],
12834=>["Value"=>12834,"TextKey"=>"新手引导说明2530","TextValue"=>"Летом лучше всего! Повеселитесь на <color=#46bb83>Пляже для отдыха</color>!"],
12835=>["Value"=>12835,"TextKey"=>"新手引导说明2531","TextValue"=>"<line-height=130%>Вы получите множество наград за участие в <color=#46bb83>Событии</color>. Они будут отправлены на ваши <color=#f58c26>Родные земли</color>!"],
12836=>["Value"=>12836,"TextKey"=>"新手引导说明2532","TextValue"=>"<line-height=130%>Здесь вам будут попадаться уникальные предметы, новые существа и новые особенности игрового процесса!"],
12837=>["Value"=>12837,"TextKey"=>"新手引导说明2534","TextValue"=>"Перетащите <color=#df66a8>Быстрый рабочий</color> на здания или объекты для строительства. Он может завершить короткое строительство в одно мгновение или уменьшить время длительного строительства на 1 час."],
12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"Добро пожаловать в <color=#f58c26>Дом Героев</color>. Здесь спрятано много увлекательных героев и историй, которые ждут вас!"],
12839=>["Value"=>12839,"TextKey"=>"新手引导说明2541","TextValue"=>"Объедините, перетащив одно <color=#ef933d>платье Принцессы</color> на два других, помогая нам освободить <color=#df66a8>Принцессу племени</color> от злого тумана."],
12840=>["Value"=>12840,"TextKey"=>"新手引导说明2542","TextValue"=>"Фантастика! Вы освободили первого героя – <color=#df66a8>Принцессу племени</color>!  <color=#df66a8>Принцесса племени</color> принесла Вам заказ деликатесов. Нажмите, чтобы посмотреть!"],
12841=>["Value"=>12841,"TextKey"=>"新手引导说明2543","TextValue"=>"Поздравляем! Вы открыли <color=#ef933d>Пшеницу</color>, ключевой ингредиент для выполнения заказов. Нажмите на<color=#ef933d>Пшеницу</color>, чтобы собрать ее!"],
12842=>["Value"=>12842,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>Книги заклинаний</color> помогут Вам устранить туман и освободить больше героев. Вы можете получить <color=#38c0a5>Книги заклинаний</color>, выполняя заказы."],
12843=>["Value"=>12843,"TextKey"=>"新手引导说明2631","TextValue"=>"My Kingdom and my people are lost in the fog! Can you please <color=#ef933d>Merge</color> three Imperial Crowns to help me?"],
12844=>["Value"=>12844,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am the Old King Hill! It seems like you are the one who woke me up!"],
12845=>["Value"=>12845,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
12846=>["Value"=>12846,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
12847=>["Value"=>12847,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
12848=>["Value"=>12848,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
12849=>["Value"=>12849,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
12850=>["Value"=>12850,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
12851=>["Value"=>12851,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soo good! Let me have a taste!"],
12852=>["Value"=>12852,"TextKey"=>"新手引导说明2652","TextValue"=>"Use the spellbook now to see what's gonna happen!"],
12853=>["Value"=>12853,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen！"],
12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
12857=>["Value"=>12857,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crytal</color> can be played as a wild card!"],
12858=>["Value"=>12858,"TextKey"=>"新手引导说明2676","TextValue"=>"Use <color=#ef933d>Speedy Workers</color> to complete construction immediately!"],
12859=>["Value"=>12859,"TextKey"=>"新手引导说明2678","TextValue"=>"<color=#ef933d>Speedy Workers</color> have ultra-high efficiency. <color=#ef933d>Drag</color> one onto a building to be constructed to see what's gonna happen!"],
12860=>["Value"=>12860,"TextKey"=>"新手引导说明2686","TextValue"=>"Complete each <color=#ef933d>Task</color> will gain you <color=#ef933d>Experience Points</color> which will upgrade your levels in the game. Tap on the Task button to learn more about it."],
12861=>["Value"=>12861,"TextKey"=>"新手引导说明2688","TextValue"=>"Do you need more <color=#ef933d>Construction Materials</color>，<color=#ef933d>Chests</color> or <color=#ef933d>Other Items</color> for help？Now the Store is open and go check what's on the shelves! There is a <color=#ef933d>Free Chest</color> for you to collect."],
