13616=>["Value"=>13616,"TextKey"=>"天气雷名称100001","TextValue"=>"Молния"],
13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Переместите молнию на предмет, чтобы другие такие предметы притянулись к нему."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Приветствую, вождь, я Тристан, ваш разведчик! Я рад, что мы все выжили в том ужасном путешествии. Мы наконец-то достигли этих земель, нужно обустроить <color=#f58c26>Лагерь</color>. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>Здесь куча зарослей! Интересно, кто и что здесь обитает? Нужно поскорее возвести палатку, чтобы защититься!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>О, боже, взгляните какая ужасная грязь... и эта ужасная палатка! Я скучаю по дому..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Успокойся, Эдна. Я знаю, что бросать дом нелегко, но нам пришлось уйти, чтобы спасти его. Все эти бедствия... мы должны найти ответ! Именно поэтому мы отправились за помощью."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%>Мы обязательно вернемся, слышишь? Давай сперва построим <color=#f58c26>Алтарь</color>, чтобы ты могла общаться с богом. Как тебе такое, жрица Энда? Вождь поможет!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Смотрите, что мы нашли!<color=#ef933d>Наследие природы</color>! Это все, что нам нужно для постройки <color=#f58c26>Алтаря</color>, а еще мы узнали, как освободиться из этих тотемов! Это священное место!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Что ж, ты не совсем бесполезен, Стэн или как тебя там. Он не такой большой и красивый, как тот, что дома, но пока сгодится! Теперь уходи!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>О, как мило, посмотри как она счастлива. Она даже по своему очень странному обыкновению благодарна."],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%>(завершая странный танец) Наш бог сказал мне, что мы в нужном месте и великий человек придет нам на помощь..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Правда? Это отличные новости! Когда же мы встретимся с этим великим человеком?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>Это вы, негодники, потревожили мой сон?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>......А ты, собственно, кто?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Я Архидруид, отец бардов, повелитель бури, защитник авантюристов, ужасающий посланник бога, судья и палач, заклинатель Амергин! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>А... Приятно познакомиться, наверное. Мы здесь недавно и услышали..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>Что?! Вы захватчики?! Я не позволю вам уничтожить наш дом и разлучить семьи! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"Что? Нет, нет! Мы не захватчики, мы просто ищем где бы отдохнуть, и, возможно, решить тайну наших родных земель..."],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"Нет! Мост! Посмотрите, что вы наделали! Боги рассердятся! Погодите... Кто вы, говорите? Амергин? Архидруид Амергин? Из легенд?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Вы... не захватчики? Кто вы? Зачем вы здесь? Погодите... Зачем я здесь, что это за место? Где мой народ? Я не помню этих земель..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Мне очень жаль, но у нас тоже нет ответов. Мы отправились в дальнее путешествие и рисковали жизнями, чтобы попасть сюда, пытаясь найти тех, кто поможет нам разгадать тайну наших родных земель. Сначала на нас опустился густой туман, затем..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"За прошлый год было больше потопов, чем за все десятилетие. Но самое интересно то, что люди стали превращаться в безжизненные тотемы! Можете себе представить?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"О...это...нелегко. Простите, что напал на вас и уничтожил мост. Может, я помогу его восстановить?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Амергин?! Великий Амергин?! Эта роба, эта способность управлять штормом... Вы настоящий! Все эти сказки из семейной книги – правда!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Рабочие! Объедините усилия и отремонтируйте тот мост!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Но мы ранены! Мы не можем начать строительство! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Я знаю, что поможет. Я узнал об этих лекарственных травах в своих путешествиях. Давайте соберем немного трав и вырастим <color=#f58c26>Сад трав</color> здесь. Так я смогу выразить свои соболезнования."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Спасибо! Вы так добры. Теперь мы сможем отправиться обратно домой и вызволить тех, кто попал в ловушки-тотемы, раз уж мы знаем, как это сделать! Отлично, вперед!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Мы вернулись и привели помощников из дома! Давайте построим сад!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Ух ты, не могу сказать, что не удивлен, вы отлично справились. Этот сад прекрасен. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>И очень полезен. Теперь работники исцелены и скоро смогут приступить к восстановлению моста!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Рад помочь."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"Кстати, жрица говорила, что вы очень умный и добрый. Я пытаюсь сказать..."],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Для нас было бы честью, если бы такой выдающийся и опытный путешественник присоединился к нам. Но вы легенда! Вы же не присоединитесь к кучке незнакомцев! Или присоединитесь? Пожалуйста! Пойдем с нами!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Конечно. Может меня за этим сюда и послали."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Я так и знала. Вы не... ЧТО?! Вы пойдете с нами?! Не могу поверить... Лучший день в ЖИЗНИ! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Прошу прощения, иногда она сама не своя. Раз уж вы решили нам помочь, как насчет приветственной вечеринки?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"Нет, спасибо, мне не до вечеринок. У меня есть более важные дела. Я поищу древесины, чтобы восстановить мост, который я сломал."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Какой благородный человек! О! Даже просто повстречать его... Лучший день в ЖИЗНИ!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Вы Вождь...верно? Спасибо, что помогли. Теперь мы готовы отремонтировать мост."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>Как новенький! Готова снова пообщаться с богом, жрица Энда?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Готова, как никогда! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Ладно, Вождь, пока жрица наслаждается воссоединением со своим обожаемым алтарем, мы можем приступить к работе..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Ой, что это у меня под ногами? А, вижу, кусок <color=#38c0a5>Руды</color> с <color=#f58c26>Алтаря</color>. Вы постоянно бросаете все куда ни попадя."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Ага, знаю! Нам нужно построить <color=#f58c26>Склад</color>, чтобы хранить ресурсы, чтобы люди не спотыкались о предметы на земле."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Собрали все, что нужно? Тогда давайте приступать к веселью! Ой, простите, то есть к строительству <color=#f58c26>Склада</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Крепкие стены и много места... Отличная работа, Вождь!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Эм.... сэр? У вас за спиной восьминогая штуковина."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"Что?! Как?! Что это?! Похоже на тело какого-то водного существа... хм-м, кожа скользкая и упругая!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Кракен</color>! Это <color=#f58c26>Кракен</color>! Я читал о них в своих книгах! Должно быть, это детеныш монстра! Откуда здесь <color=#f58c26>Кракен</color>?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Не нужно паниковать. Во-первых, он наверняка мертв, а во-вторых это просто выброшенный на берег <color=#f58c26>Осьминог</color>."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Осьминог? Никогда не слышал о таком..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Значит, ваш народ из внутренних земель. Мой народ кочует. Мы полагаемся на море. Осьминоги для нас также обыденны, как звезды в небе."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"Пойдем со мной, нужно найти веревки и ветки. Я покажу тебе, как построить палатку из кожи осьминога."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>....и...готово. В моем представлении она выглядела лучше."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>Она...эм...э-э...милая!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Прошу прощения. Я больше разбираюсь в теории, чем в практике. Строительство – не мое. А теперь... Мне нужно прилечь..."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"О, великий Амергин! Почему бы вам не отдохнуть в основной палатке, где я составлю вам компанию! Вы поделились со мной своей мудростью, и я в вечном долгу."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Это сбывшаяся мечта детства для жреца. Очень рад, что вы подружились. Однако, все какое-то странное, вам не кажется, вождь?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Старейшины говорили, что отправившиеся в путешествие по морю не возвращаются, кроме тех, кто сходит с ума и твердит об огромной преграде на краю мира."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Но Амергин сказал, что они - народ моря! В море не живут люди!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>Вот мне и стало интересно. В любом случае, он не причинил нам вреда. Давайте займемся насущными проблемами. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Мы немного разведали земли и нашли огромное количество трофеев. С помощью скота я отнесу их домой. А чтобы им было удобнее, нам следует построить <color=#f58c26>Загон для животных</color>."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Неплохо, Вождь! Похоже, что они тут же пригодятся, отлично!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Мы почти закончили строительство, но мне нужно ваша помощь еще с кое-чем."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>Если какие-то негодяи захотят разрушить наш лагерь, пока нас нет, нам понадобится команда опытных разведчиков, которые будут патрулировать и защищать нашу территорию."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>На понадобиться <color=#f58c26>Площадка для тренировок</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Верно, Кевин, <color=#f58c26>Площадка для тренировок</color>. Давайте поищем материалы!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Вы готовы?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Да, сэр!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Вождь приготовил материалы, давайте приступать!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Да, сэр! Без проблем, сэр!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Отличная работа! Теперь нужно... Жрица? Что не так?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Я говорила с Архидруидом Амергином, пока мы не уснули от истощения, и нам обоим приснился странный сон, в котором богиня сказала нам «Спасите <color=#f58c26>Сердце моря</color>......»"],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Сердце моря</color>? Что это такое?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"У нас есть старая сказка об огромном пузыре в море, который охраняет самая молодая из богинь. В ней выжили лишь самые древние животные, но великаны и феи все еще живы. Но это просто сказка на ночь."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Я должна разобраться в чем дело. Чтобы получить более понятное сообщение от богини, мне понадобится <color=#f58c26>Мощная рунная основа</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Понял. Ладно, Вождь, давайте найдем немного руды и построим основу для Энды."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Почти готово! Можно отметить!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Ура-а!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Рано праздновать! Я не могу сосредоточиться со всем этим шумом!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>Я пыталась связаться с богом, а вы идиоты мне помешали!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Замолчите и оставьте меня в покое!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Ой, кажется, у кого-то день не задался."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Подождите! Тихо! Кажется, я ее слышу. Это очень важно."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Хм-м... я не совсем понимаю... но мне кажется... нам нужно отправиться на север, где нет растительности и никто не живет. Там мы найдем друга."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Ладно, думаю... справимся? То есть, что такого может произойти! На север! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Но сначала, самое время отпраздновать обустройство нового Лагеря! Собирайтесь в круг, у нас будет отличная вечеринка!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Ура-а!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Мы покинули дом, считая, что никогда не вернемся, но затем нашли этот чудесный остров, встретили новых друзей и даже нашли способ возродить членов племени, который считали погибшими."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"За это все нам следует благодарить богиню, которая приглядывала за нами и указывала путь, и нашего нового друга Амергина, который безвозмездно поделился с нами своей мудростью."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Но, важнее всего, Вождь, мы бы не справились, если бы вы не оставались сильным и заботливым. Спасибо, вождь, за все, что вы сделали для нас и... эм... жрица, ты рыдаешь?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Я... Я не... *хнык* рыдаю... просто... *хнык* Ладно, рыдаю! Доволен?! Я люблю вас Вождь! Вы самый лучший Вождь! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Думаю, что больше ничего не нужно говорить, Вождь. Не могу дождаться продолжения нашего путешествия. Однажды, мы обязательно разгадаем тайну нашего дома и восстановим его."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Не торопитесь, парни, мы почти на месте..."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Храни нас богиня! Мы идем по пустыне уже много дней, дай мне немного воды. "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Имей терпение! Когда я была в твоем возрасте... Эй, что это?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>О-О-Й!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Жрица?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>О, нет, жрица, ты упала? Ты в порядке?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Ну... я все еще жива... Хм-м, кажется я упала из-за этой... волшебной шахты?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Слава богам, ты в порядке. Не волнуйся, мы постараемся вытащить тебя как можно скорее."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Вождь, я нашел заброшенное здание на холме неподалеку. Внутри я увидел большое устройство с веревкой, но оно покрыто жуткой жижей."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Я думаю, это какая-то <color=#f58c26>Старая мастерская</color>."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Мы можем попытаться открыть дверь и убраться в ней, чтобы сделать лебедку и вытащить жрицу."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Тогда хватит болтать и вперед делать лебедку!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Спокойнее, жрица! На улице темнеет, скоро снаружи будет жутко холодно! Нам нужно найти материалы для постройки <color=#f58c26>Палатки</color>, и принять решение после отдыха."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>А как же я?! Я могу замерзнуть до смерти!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Не волнуйся, сильные перепады температуры происходят только над землей. Ниже поверхности все будет в порядке. Держись, жрица! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"На следующий день......"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>Отлично выспались! Как у тебя там дела, жрица?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>Я была бы признательна, если бы вся эта энергия была потрачена, на то, чтобы меня вытащить, а не узнать как у меня дела!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Мы уже работаем над этим, мне лишь нужно кое-какие инструменты, чтобы открыть дверь. Успокойся. *улыбается*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Дождись только, когда я выберусь... Неблагодарный мелкий негодяй..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Ай, мои чувства сильно пострадали! Как же можно так поступать с моим чутким сердцем! Но я тебя прощаю. Мы с Вождем скоро вернемся!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Отлично, мы внутри! Теперь нужно только......"],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Сэр, осторожно! Сзади!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Ай! Откуда взялась эта стрела?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Прочь из здания!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Кто там?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Прочь! Вор!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Вор? Мне кажется, вы нас с кем-то спутали, госпожа-голос... Ай, ай, ай!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Госпожа-голос, мы вышли из здания, теперь вы нам все объясните?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Во-первых, меня зовут нет Госпожа-голос, я Тлахтга, охотница молний, дочь Маг Руита, мать всех земель, героиня..."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Великая Тлахтга!!!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"Что......Откуда этот голос......С подножья холма? Кто-то упал в ту шахту?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Вы трое, стойте на месте, пока я не вернусь. Если вы сдвинетесь хоть на миллиметр, вы сами знаете, что будет."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Да, мэм, ни шагу!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Вот ты где. Жрица? Что ты там делаешь? Я проломила вход в эту шахту в поисках кое-кого, как ты там оказалась?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Если коротко, то я путешествовала с теми тремя парнями, которых ты поймала, но затем упала в шахту. Но это неважно. Ты здесь! Я предвидела, что мы встретим друга, который поможет нам в этих пустынных землях. Не могу поверить, что это ты!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Друга? Поможет? Зачем? Вы... не воры?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Воры? Нет-нет, мы просто проходили мимо, в поисках тех, кто поможет нам спасти наш дом! *Объясняет*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Хм. Когда ты это сказала, я вспомнила, что Мама говорила о встрече с группой похожих людей... но затем она пропала... Значит я действительно вас с кое-кем спутала."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Мама?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Забудь, это неважно. Полагаю, что твои парни попали в мою ловушку, пока пытались починить лебедку, чтобы достать тебя?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Да, мудрая госпожа, все именно так, и поэтому я здесь застряла."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Ох, это моя вина, я помогу тебе с ранами немного позже. Сейчас мне нужно обезвредить ловушку и починить лебедку..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>Лебедка отремонтирована и работает. Отличная работа, госпожа!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Вовсе не отличная! Вытащите меня, немедленно!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Осталось всего одно дело. Нам нужно приготовить веревку и лебедку, прежде чем тебя вытаскивать."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Да вы надо мной издеваетесь...... *Прослезилась*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Вождь, вы уже собрали материалы? Можете не торопиться, раз уж здесь нет Энды, мы можем насладиться покоем......"],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Я вас все еще слышу! Так нельзя!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Ой! Я не знал, что ей слышно...... Ага, лебедка готова!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Дорогая жрица, спасательная команда спустилась, покажи себя, чтобы на тебя случайно не наступили......"],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Вы уже стоите на мне! Слезайте! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Похоже, жрицу скоро поднимут. Спасибо, госпожа."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Не нужно «госпожи», меня зовут Тлахтга. А теперь посмотрим, куда именно я попала?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>В лодыжку, госпожа, то есть, Тлахтга."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Понятно. Охотники, такие как я, умело справляются с обработкой ран. У меня в шахте припрятан мешок с мясистыми листьями. Давайте вырастим побольше таких и вотрем сок в рану, чтобы залечить твою ногу!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Ох...бедная нога...ладно. Значит, нам нужно спуститься туда? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"Нет-нет, вам, мелкотне, понадобятся факелы, чтобы что-то рассмотреть внутри. Шахта куда глубже, чем кажется. Найдите несколько факелов и инструменты для раскопок!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Держи. Если огонь потухнет, останавливайся и иди обратно, ясно?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Готовы! Вперед! Смотрите под ноги!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Да, госпожа!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Вождь, спасибо, что остались здесь со мной и жрицей. Я немного расстроен, что мне не довелось спуститься, но Тлахтга сказала, что будет лучше, если я останусь здесь, чтобы не потерять ногу. Жду не дождусь, пока они вернутся!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Не могу поверить, что великая Тлахтга позволяет тебе называть ее по имени. Какая честь! А ты не выразил даже скромнейшей благодарности..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>О, господи, что это?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>Это подземная река! Не могу поверить, что наша команда смогла найти <color=#f58c26>Подземную реку</color>! Теперь у нас будет вода!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>И промокшая одежда."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Возьми себя в руки, нытик! Это просто вода! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Эй, Вождь, теперь у нас есть вода и мы можем вырастить немного мясистых растений! Мясистый листок, простой заговор и должный уход быстро поставит тебя на ноги!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Пускай эти дамочки поищут ведра, лопаты и удобрение. Я подожду здесь."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>Итак, готово! Посмотрите, какой он милый! Возьми кусочек побольше."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Мне никогда не доводилось видеть таких растений... Что? Взять кусок?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Да, возьми лист и выдави сок, а затем обработай им кожу вокруг раны."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Ладно......Взять лист...... Потереть...... Ух ты, сработало! Никогда не встречала трав, которые заживляют раны так быстро!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"Люди не просто так называют меня матерью земель, знаете ли. Я полагаю, что этот титул как-то связан с моими выдающимися способностями к выращиванию растений. Это не обычные травы. Я вывела этот вид лично."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Это просто чудо! Ох! Теперь я снова готова разгадывать тайну наших родных земель! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"Да, кстати, мне очень нужно передохнуть, у меня совсем не осталось сил. Можно мне поспать у вас «Дома»? Это ваш лагерь? Там есть кровать?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Да, это наш основной лагерь, а вот карта, на которой мы отметили обратную дорогу. Но... Ты планируешь просто передохнуть или присоединишься к нам?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Конечно, я к вам присоединюсь! Вы глупые что ли?! Вам нужна помощь, а я ничем не занята. Почему бы и нет? Мы, скорее всего, преследуем одного и того же человека. Я пойду спать, увидимся!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"Ушла. У меня хорошее предчувствие, что она станет отличным другом нашего народа. Давайте закончим строительство лагеря. Как и в прошлом поселении, но будет нужен <color=#f58c26>Склад</color>, чтобы хранить материалы."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Давайте соберем ресурсы для <color=#f58c26>Склада</color>!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Отличная работа! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Вы еще не поблагодарили меня за обнаружение воды! Я же говорила, что была права насчет этого места!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Ладно, ладно. Я буду чтить все твои будущие предсказания и потакать любым странным запросам. Что нам делать дальше?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Ах ты...! Неважно. Мне нужно снова пообщаться с богиней, чтобы узнать, куда направляться. Теперь мне нужна <color=#f58c26>Дозорная вышка</color>, чтобы попрактиковаться в астрологии. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Почему в астрологии? Мы даже не знаем, что это за звезды. Это же просто сияющие точки в небе!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>У нас нет времени! Нам предстоит много работы! Хватит этой нелепицы!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Отправляйтесь на поиски материалов и возвращайтесь поскорее!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Ладно..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Взрослые говорили мне не донимать старейшин, почему я не послушал......"],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Итак, вождь, вы сделали все необходимое, теперь осталось только построить <color=#f58c26>Дозорную вышку</color>, как и просила жрица......"],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Я тебя слышу, негодяй! Хватит ныть и за работу!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Ладно-ладно *вздыхает*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ладно, вождь, я пойду поговорю с богами."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Можете пока отдохнуть, скоро увидимся."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Шепчет* Эй, вождь, сюда..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Энда наконец-то может остановиться."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Наша группа нашла кучу золота и руды в шахте."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Мы решили, что нужно сделать сундук для транспортировки добычи, поэтому нам нужна ваша помощь."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Можете собрать немного материалов для сундука?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Ух, там было немало золота. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>Что это? Оно светится..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>Это маленькая упаковка...с надписью «съешь меня». А внутри <color=#f58c26>Светящееся семя</color>? Значит, нужно съесть семя?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Предоставьте это мне!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>Что?! Жрица, что ты делаешь?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Ты его съела? Мы же даже не разобрались, что это!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"Звезды выстроились в созвездие над <color=#f58c26>Великим ущельем</color> к <color=#f58c26>юго-востоку</color>, и <color=#f58c26>успокаивающее семя</color> поможет мне повстречать велик... *храпит*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Жрица? Жрица? Ты здесь?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Храпит*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>Она уснула. Никогда не понимал людей с таинственными умениями. Они такие странные. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Ох, куда нам идти, раз уж жрица без сознания?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>Она сказала <color=#f58c26>Великое ущелье</color>, верно? На <color=#f58c26>юго-востоке</color>?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Можно ли ей верить? Она немного... сама не своя в данный момент?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Да, я пообещал ей, что буду верить с тех пор. Кроме того, куда еще нам идти? Давайте сегодня отдохнем, а завтра пойдем на юго-восток."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Эй ты!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Я?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Да! Ты. Не поможешь старушке?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Эм-м...Меня здесь нет."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Да? И почему же?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Я со своим племенем. Мы ищем героев, которые смогут помочь нам решить тайну нашей родины."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Понимаю. На самом деле я говорю с твоей душой через этот светящийся камень в твоей руке?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Мой...... <color=#f58c26>телефон</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Да, именно. <color=#f58c26>«Мой телефон»</color>. Поможешь мне?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Погоди...... Ты чувствуешь мой *запах*?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Ох, дорогуша, хоть я и слепа на один глаз, я все еще чувствую все вокруг. Ты поймешь все позже. А теперь, можешь мне помочь?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Ладно. Что нужно сделать?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"Твое племя будет проходить мимо, верно? Я притворюсь, что мне очень нужна еда и построю<color=#f58c26>Небольшую палатку</color>, чтобы продать весь мой мусор. О боже, гениальный план!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Не понимаю..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Я не хочу помогать всяким грубиянам, ясно? Тебе придется быть вежливой, чтобы получить от меня помощь."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"Ну?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Если они купят мои безделушки и дадут мне еды, все в порядке. А если просто дадут еды, еще лучше!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"А если нет, то я просто щелкну пальцами и твоего племени не станет. Понятно? А теперь найди для меня ресурсы!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Удивительно! Большое спасибо! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Надеюсь, что моя дочь такая же полезная и надежная, как ты. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Нам пришлось разлучиться в пустыне, и я потерялась... Я не очень хорошо ориентируюсь в местности. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Ты знаешь где она сейчас?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Конечно, я знаю где она! Но она не может просто... перестать искать меня! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Приятное чувство. Правда ведь? Только ты и я, сидим, болтаем, пьем чай..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Они идут. Теперь нужно просто подождать."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"......"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Прошло много времени."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Я заберусь на вон те кости и посмотрю где они."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Ха! Вон они! Эта ваша жрица невероятно милая!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Ладно, они скоро будут здесь. Не могу дождаться встречи с твоим народом! Мне нужно осторожно спуститься....."],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Ты в порядке?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"Эй?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Мгновение спустя"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>"«Умираю с голоду, прошу, купите вещи, дайте еды». Хм. Похоже, кто-то здесь завел бизнес."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Вождь, вот вы где. Жрица Энда сказала, что кто-то из ее видения ждет нас здесь. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Здесь есть следы активности, но костер потух, а палатка сейчас развалится. Вокруг никого... Нас обманули?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"Так или иначе, нужно разбить лагерь и провести здесь ночь, пока мы дожидаемся этого «человека из видения»."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"У меня совсем нет сил... наконец-то... как же жарко в этом плаще! Сейчас зажарюсь! Снимите!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Дорогая жрица, ты спала на спине верблюда. У тебя не может «не быть сил»."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"Кстати, плащ снимать тоже нельзя. Сейчас может и быть жарко, как в аду, но ночью будет очень холодно."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Боги... зачем вы привели меня в это пустынное место... и заставляете терпеть этого заносчивого нахала..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Прояви терпение. Вождь соберет материалы на постройку <color=#f58c26>Палатки</color>."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Отличная работа, Вождь! Начнем!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Замечательно! Думаю, что все уже проголодались. Давайте не терять время даром и приготовим что-нибудь. Хорошо поработал – хорошо поешь!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Ура-а! Еда! Бекон!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Мне, пожалуйста, каре ягненка..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Плотоядные дикари!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Что ты хочешь?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Стейк, средней прожарки с соусом из редиса, пожалуйста."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Жрица, это тоже..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Я знаю! Тихо!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Хех, белок очень важен для здоровья путешественника. Путь был нелегким, давайте поедим, как следует! Что скажете, Вождь?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"У нас не так много материалов для готовки..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"У нас есть баранина, сушеная говядина и яблоки, Вождь!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Но Вождь прав, нам нужно оставить немного на предстоящие ночи. Нужно найти альтернативный источник протеина."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Я видел несколько пустынных ящериц. Они и их яйца – отличный источник белка!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"Что ты сказал?! Ящерицы?! Как можно есть ящериц?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Они становятся настоящим деликатесом, если проявить креативность! Например, «рагу из ящерицы» звучит довольно аппетитно!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"Жду не дождусь!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Ох...... охота на ящеров......"],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Чудесно! Мы собрали все нужные материалы! Вперед!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"Иду! Зажигайте костер!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Наконец-то... Еда... Я уже едва держусь на ногах... Глазунья... Стейк... Запеченное яблоко..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Баранина для Арлана, глазунья для Кевина... А мы с жрицей Эндой разделим эту миску превосходного рагу из ящерицы..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Ничего подобного!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"В таком случае, я отдам эту миску с теплым, ароматным и аппетитным рагу нашим новым друзьям."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"Новым друзьям? Каким еще новым друзьям?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"А! Не-е-ет! Уберите от меня этих крыс!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Они слишком большие для крыс. Согласно моим исследованиям, это Маубиты – грызуны, обитающие исключительно в засушливых регионах."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"Они на удивление робкие, несмотря на их размеры, и поэтому не представляют опасности для людей."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Ладно, ладно, знаю!! Мне плевать, что они такое! Сними их с меня!!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Кстати, очень странно, что они совсем тебя не боятся......"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Уважаемые рабочие, будьте так любезны, снимите этих милых существ с нашей жрицы."],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Да!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Эй! Отдай!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Вот и все. Кажется, что они боятся всех, кроме жрицы."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Они забрали мое кольцо! Мое любимое кольцо..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Бедная жрица. Похоже, придется последовать по их следам внутрь останков дракона. В любом случае, эти существа показались мне довольно интересными. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"Учитывая насколько крутой подъем наверх этой горы, нам понадобится <color=#f58c26>Мельница</color>, чтобы транспортировать людей."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"У нас уже есть все материалы, необходимые для постройки <color=#f58c26>Мельницы</color>?! Потрясающе!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Мельница сейчас будет готова!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Круто! Теперь подниматься и спускаться по склону будет гораздо безопаснее!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Отлично! Поторопись и принеси мне мое кольцо! Оно священно!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Ладно, ладно, идем! Кевин, Арлан, вы готовы?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Как обычно!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Эм...сэр...я, конечно, не трус, но мне кажется что нам все еще нужна веревка, чтобы не упасть с утеса......"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Да, ты совершенно прав! Безопасность прежде всего! Вождь, найдите немного защитной экипировки!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Теперь мы готовы?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Да!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Красота! Давайте уже разгадаем тайну Маубитов! Как волнительно!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"И верните мое кольцо!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Ух ты, какая глубокая куча костей! Подождите... на дне что-то блестит...Хм-м...Может это кольцо Энды?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Вождь! Смотрите, что мы нашли! Какая-то старая измазанная в грязи женщина!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"И кольцо жрицы."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Сквозь слезы* Спасибо, Арлан, ты самый благоразумный из нас всех... Погоди... Что?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Звуки радости*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Что ж......Спасибо?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Звуки cчастья*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Звуки радости*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"О, здравствуйте! Привет! Вы так гостеприимны! Я вас знаю? У вас знакомая шерсть..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"О! А ты должно быть та маленькая жрица из моего сна? Ты даже милее, чем я думала!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Маленькая? Как ты смеешь называть меня маленькой?! Я благородная посланница Бога..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Прошу прощения, ты сказала, что видела нашу жрицу во сне?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Ох~ Молодой человек! Да! Я говорила вашей жрице во сне: «Я буду тебя ждать». Но я не знаю, что это означает!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"Что значит «ты не знаешь, что это означает»?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"На самом деле, забавно получается. Я совсем не помню своего имени, поэтому я не знаю, что означает этот странный сон. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Наверное, я сильно ударилась головой, когда упала в яму. У меня все еще кружится голова, когда я хожу. "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Вон та палатка принадлежит тебе? На ней сказано «Умираю с голоду, прошу, купите вещи, дайте еды»?"],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Учитывая, что эта надпись очень точно отражает мое состояние и то, что мы посреди пустыни, полагаю, что она действительно моя."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"О! Не волнуйся! У нас есть еда. Можешь поесть у нас в палатке."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Это было бы замечательно!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"А, еще одно, я чувствую запах бекона, запеченных яблок и...... <color=#f58c26>надвигающейся бури</color> в воздухе. Вам следует приготовиться. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"И... она ушла. Ладно, Вождь, думаю, вы слышали. Ветер становится сильнее, давайте посмотрим......"],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"Нам нужно утяжелить и укрепить палатку."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Почему мы должны ее слушать? Мы не знаем откуда она, а вы сразу ей поверили! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Как и с моими предсказаниями... Ты всегда выделяешь какую-то одну ошибку и постоянно придираешься! Я узнаю, что скрывает эта женщина, вот увидите!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"О-о-ох, кто-то боится конкуренции. Итак, Вождь, я составил список материалов, которые нужны для <color=#f58c26>укрепления палатки</color>, взгляните."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Эм-м, вкусный чай."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"И печенье тоже очень хорошее, прямо тает во рту. Хоть оно и немного пригоревшее. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"В следующий раз можете сделать температуру пониже и печь его немного дольше."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Почему это она устроила обеденное чаепитие?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"В чем дело?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"И откуда этот странный британский акцент?! Мы даже не в том столетии!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Успокойся, маленькая жрица. Все будет хорошо. Ты все поймешь."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"Нет! Не будет! И я ничего не собираюсь понимать! Боже... Откуда взялась эта женщина......"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Раз уж ты так вежливо спросила, и благодаря этому чудесному чаю, который мне довелось отведать......"],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Мне кажется, что я кое-что вспомнила. Ну, то есть, если честно, по правде говоря, дело в том..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Да говори уже!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Вы можете укрепить и мою <color=#f58c26>Небольшую палатку</color>?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"Что?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Мне, бедной худой старушке, путешествующей пешком долгие дни, пришлось построить этот шалаш, несмотря на голод...... Бедная я женщина!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Я не переживу, если мой шалаш развалиться. Моя судьба зависит от вас! Я буду бесконечно благодарна!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Какая интересная дамочка."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"Прошу прощения, что ты сказала?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Вождь, я составил список материалов, посмотрите его."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Хватит меня игнорировать!!! Господи, это невыносимо!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Красота! Вы все – чудо!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Мама! Я знала! Я знала, что это ты!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Великая Тлахтга, как ты здесь оказалась?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"А кто эта молодая девушка?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Тлахтга! Твоя дочь! Хватит придуриваться! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"Вестник сказал мне, что они нашли старую женщину в куче костей. По описанию она была похожа на тебя и я решила проверить."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Я совсем не удивлена тебя здесь видеть."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"Мать Тлахтги... Я никогда не слышала, что у Тлахтги есть мать..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Конечно, у меня есть мать, тупица!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Следи за языком."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Короче, эта сумасшедшая старушка – Маг Руит, во плоти."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Называйте меня Мэг."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Я думала, что Маг Руит – мужчина..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"В сказках мою маму описывают по разному. Она скрывала свою истинную личность, когда я была маленькой."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Сами понимаете, куда проще угрожать слепой женщине и трехлетнему ребенку."],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Думаю, из-за этого и пошли слухи... всемогущий всезнающий друид, слепой воин, великий рыцарь..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"А на самом деле, она просто слепая женщина со странным чувством юмора."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Маг Руит – женщина... и я нагрубила Маг Руит...Ох...Я обречена... Я не имею права быть жрицей..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Не унывай, маленькая жрица. Ты обязательно научишься вежливости~ Я прощаю тебя на этот раз, потому что ты очень милая!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Значит, ты нас обманула? Ты не теряла память?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Да... простите за это. В долгих путешествиях становится скучно, понимаете? Просто развлекалась~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Но вы только посмотрите на эту замечательную палатку и шалаш! Теперь это место начинает быть похожим на Лагерь! Хотя, еще чего-то не хватает...."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"Чего не хватает?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Посмотрим..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Ворота! Нужны ворота, чтобы обозначить вход в лагерь, а еще светильники. Будет потрясно!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"Мы будем вашими самыми верными слугами и построим ворота, госпожа! Вождь, соберитесь!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Все собрали? Отлично! Теперь за дело!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"О! Восхитительно! Это первый строительный проект, которым я руководила......"],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Поздравляю, жрица, ты так изменилась. Но я не уверен, что Мэг довольна тем, как теперь выглядит лагерь."],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Все в порядке, но пустое небо немного удручает......"],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Знаю! Знаю! У нас есть сигнальные шары, которые могут парить в небе!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"Отличная идея! Как раз то, что нужно, чтобы придать нужное настроение. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"У тебя еще остались те светящиеся желтые и розовые камни?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Еще бы!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Замечательно. Дайте мне минуту. Кевин, пойдем."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Ох, неплохая разминка. Но вы только взгляните, разве они не прекрасны?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Да, весьма."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Рада, что тебе нравится. У мамы очень редко получается сделать что-то нормальное. Ладно, уже поздно, пойду обратно. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Уже уходишь?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Да, а что? Я не собираюсь тесниться с кучей потных мужиков в маленькой палатке! Мам, ты со мной?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Я тебя догоню. Твои новые друзья очень милые, особенно эта чудная маленькая жрица! Хочу немного побыть с ними~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Мам, держи себя в руках."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Знаю, знаю, я себя контролирую. В конце концов, нам еще предстоит пройти долгий путь вместе."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Ладно. Увидимся."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Ты только что сказала, что собираешься к нам присоединиться?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Конечно, почему нет? Ваше путешествие будет становиться только опаснее. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Я мало чего умею, но я смогу пролить свет на то, с чем вам предстоит столкнуться."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Но мне будет нужно, чтобы вы показали мне путь к вашей Родной земле. Я просто... ужасно ориентируюсь на местности."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Ой... Зачем такое место существует на земле?! Мои ноги как будто ходят по пламени..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Впечатляет, Энда! Вздох... На протяжении четырех часов ты не сказал больше пяти слов."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Я...слишком устал...слишком жарко..."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Кучка хрупких кукол! Это всего лишь вулкан. Посмотрите на свои позы, как будто собираетесь лечь на землю!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Мадам... У вас тоже пот ручьем. Вы в порядке?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Зовите меня Тлахтга!... Я не устала, но здесь действительно очень жарко... что гораздо опаснее, чем на море."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"Кажется, мы добрались."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Дай мне посмотреть! По наставлению Богини, есть море в огне с островами в нем..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Да, это должно быть здесь!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Но где Амергин? Амергин должен был прибыть и ждать нас здесь, но его нигде не видно."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Я должен построить алтарь, чтобы ощутить следы Амергина. Но..."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"О… Вождь, Я…"],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Энда!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Энда!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"У нее должно быть тепловой удар! Поторопитесь! Постройте навес, чтобы она могла отдохнуть!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Сэр, строительство завершено!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Богиня, кажется, я проживу еще немного..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Действительно, слишком жарко! Я так скучаю по запаху моря..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Уф, наш священник выглядит намного лучше."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"Немного лучше иметь палатку, защищающую нас от горячего воздуха..."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Но лишь немного."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Святая Богиня! Пожалуйста, переверни меня, чтобы я поджаривался равномерно..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Я должен сказать, что это место действительно похоже на большую печь."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Смотри, там низина!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Вот вы, ребята! Моя мама буквально родила гения."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"Потрясающая Тлахтга! Это вода! ВОДА!!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Ха, я думал, наш благочестивый священник видел Богиню."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Я вернулся к жизни и чувствую себя неплохо!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Я вижу, что вы, ребята, действительно более энергичны!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"В таком случае... вы, вы и вы, поторопитесь и создайте тренировочное кольцо!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Тренировочное кольцо?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Да, верно!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Разве мы не должны искать Амергина?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Амергин... этот старик. Я знаю, что он может управлять силами природы, как куском пирога."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"Взаимно, ребята, эти прогулки отняли буквально половину вашей жизни. Как мы можем забыть про физичекую подготовку?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Что ж, Энде нужно больше упражнений."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Замолчи!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Согласно пророчеству моей матери, нас будут ждать только более сильные бури..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"Пророчество Маг Руит..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Молодые люди!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Понятно!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Посмотрите на нагорье на севере! Там вообще природная лестница."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Да, сэр!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Вы заметили столб посередине? Он не может быть природным. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"С такой высотой и формой... Клянусь репутацией моей семьи священников, должно быть, в старину это служило алтарем!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Этот алтарь выглядит заброшенным."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Да, должно быть, он очень старый."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Такой алтарь, неспособный резонировать с силой Верховного друида, не мог помочь нам найти Амергина."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Вождь, нам нужно устройство, которое может конденсировать энергию..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Здесь материалы должны выдерживать высокие температуры, а форма должна быть направлена ​​внутрь."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"Как насчет тех странных клыков возле лавы?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Неплохо, Арлан! Не зря в прощальном напоминании Богини говорилось, что «всегда держись рядом с важными партнерами»!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Конечно! Спасибо Богине!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Замолчи! Ты не включен!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Оставим все материалы нашему замечательному вождю!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Вождь, мы уже очень продвинулись."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"Алтарь должен быть подходящим для использования!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Но посмотрите на хмурое небо! Энда изо всех сил пытается подниматься и спускаться по лестнице к алтарю. Что, если он упадет?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Неплохо, что-то…. А иногда вы не так уж и раздражаете."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"В конце концов, Энда уже стар… ммм… я имею в виду уже не молод."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"Зачем ты меня злишь?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Построим факелы по обеим сторонам лестницы - это очень просто!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Я чувствую этот алтарь… все еще чего-то не хватает, потому что он вообще не ощущает Богиню…"],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Но этого должно хватить, чтобы почувствовать Амергина!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Холодно… ах… Кто там?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Амергин! Где ты?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"Ты... ты Энда? Я понятия не имею, где я... Но здесь так холодно..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Холодно?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"Кажется, что он где-то в другом месте."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Не могу двигаться… Помогите, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"Что ты сказал?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Привет, Энда. Я думаю..."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Амергин! Держись! Мне нужно поговорить с другим человеком, это может тебе помочь."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Тлахтга, ты раньше сталкивалась с такой ​​ситуацией?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Hey…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"Духовное общение на самом деле не моя компетенция. Но моя мать столкнулась с такой же ситуацией. Проблема все равно должна быть в алтаре."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"Сила алтаря все еще слишком слаба, отсутствует самое главное."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"Сила Богини… @#$>:%^Сущность"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Вождь, кажется, я понял. Посмотрите на пустоту наверху колонны алтаря!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Нам нужно наполнить Эссенцию духа и усилить силу алтаря. Есть ли она у нас?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"Что скажешь? Арлан, сейчас я тебе ее передам."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Получил!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Амергин, скажи что-нибудь!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Приходи и найди меня…"],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"На этот раз все должно быть хорошо. Твой голос, наконец, не звучит двусмысленно, как у Мэг-притворщицы."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Мэг просто старушка."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Как вы и сказали…"],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Однажды я добрался до вулкана, но понятия не имел, что случилось потом. Но что бы там ни было, когда я проснулся, я уже был здесь."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Хотя ваш алтарь может дотянуться до меня, я думаю, он не может привести вас туда, где я..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Потому что, несмотря на то, что я могу чувствовать и реагировать на Энду, но это место... определенно не появится, ему удастся скрыться."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Есть идеи?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Сосуществует с окружающей средой…бесконечно…и образует круговорот."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"Что ты имеешь в виду? Пусть пламя выльется в ледяной погреб, в котором вы находитесь?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Тупоголовый студент! Конечно, нет."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Циркуляция… Позвольте лаве течь, чтобы образовался пепел, позвольте пеплу подняться и затвердеть в скалы, и, наконец, позвольте скалам снова извергнуться в лаву."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"Ты действительно лучший ученик."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Подождите!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"Неужели это… голова свиньи?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Угу."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"При всем уважении, почему это по форме напоминает голову свиньи?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Подождите, я не должен задавать этот вопрос."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Богиня! На пути к успеху нужны самые близкие партнеры. Почему бы нам не оставить здесь моего напарника, какую-нибудь фигуру?"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Посмотрите, какой милый у нас священник! Оцените этот тонкий способ быть милым. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Ты!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Уходите с дороги, мы с вождем собираемся запустить алтарь."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Вздох... Энда, представление начинается."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Амергин внутри…"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"Дальний Восток… Место, где мороз и запрещено находиться."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Хотя здесь очень жарко, я думаю, нам стоит начать готовить зимнюю одежду."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
